import React from "react";
import DashboardHome from "./pages/DashboardHome";
import Footer from "./components/Footer";
import Header from "./components/Header";
import Menu from "./components/Menu";

function App() {
  return (
    <div className="wrapper">
      <Header />
      <Menu />
      <DashboardHome />
      <Footer />
    </div>
  );
}

export default App;
